import React from 'react';
import ReactDOM from 'react-dom/client';
function Car(props) {
    return <h2> am a {props.brand}!</h2>;
}
function Garage() {
    var carName = "Maruti";
    return (
        <div>
            <h1>Who lives in my garage?</h1>
            <Car brand={carName} />
        </div>
    )
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <Garage />);
